import React from 'react'

export default function Home() {
    return (
        <div>
            <h1>Bienvenue</h1>
            <h6>Atb’s jewelry c’est un petit business de bijoux qui sont fais à la main , c’est le paradis des femmes . Vous pouvez trouver toute genre de bijoux qui vont matcher avec vos tenue , du doré , de l’argenté , classe , casual …
Chaque génération du petit au plus grand , trouveras ce qu’elle voudra de chez nous , il vous suffit juste de nous contacter et de personaliser votre bijoux .</h6>
        </div>
    )
}
